CREATE DEFINER=`af25andrb1`@`localhost` FUNCTION `get_email`(first_name VARCHAR(255),
    last_name VARCHAR(255)
) RETURNS varchar(255) CHARSET utf8mb4 COLLATE utf8mb4_general_ci
    READS SQL DATA
    DETERMINISTIC
BEGIN
	DECLARE email_address VARCHAR(255);
    DECLARE person_check INT(11);
    SET person_check = NULL;
    SELECT p.people_id INTO person_check FROM People p WHERE p.first_name = first_name AND p.last_name = last_name;
    IF person_check IS NULL THEN
		SIGNAL SQLSTATE '22003'
        SET MESSAGE_TEXT = 'Person does not exist in table',
        mySQL_ERRNO = 1146;
	END IF;
    SELECT p.email INTO email_address FROM People p WHERE p.people_id = person_check;
    RETURN email_address;
END ;;
DELIMITER ;
