DELIMITER ;;
CREATE DEFINER=`af25andrb1`@`localhost` FUNCTION `get_email_list`(person_type INT(11)
) RETURNS longtext CHARSET utf8mb4 COLLATE utf8mb4_general_ci
    DETERMINISTIC
BEGIN
	DECLARE DATA LONGTEXT;
    IF person_type = 1 THEN -- returns current student mailing list
		SELECT JSON_ARRAYAGG(JSON_OBJECT('name', name, 'email', email)) INTO data
		FROM
		(	
			SELECT CONCAT(p.first_name, " " , p.last_name) as name, p.email as email FROM People p JOIN Students s ON s.people_id = p.people_id WHERE p.people_id = s.people_id AND s.enrollment_status = "enrolled"
		)data;
		return data;
    ELSEIF person_type = 2 THEN -- returns admin mailing list
		SELECT JSON_ARRAYAGG(JSON_OBJECT('name', name, 'email', email)) INTO data
		FROM
		(	
			SELECT CONCAT(p.first_name, " " , p.last_name) as name, p.email as email FROM People p JOIN Admin a ON a.people_id = p.people_id WHERE p.people_id = a.people_id
		)data;
		return data;
	ELSEIF person_type = 3 THEN -- returns falculty mailing list
		SELECT JSON_ARRAYAGG(JSON_OBJECT('name', name, 'email', email)) INTO data
		FROM
		(	
			SELECT CONCAT(p.first_name, " " , p.last_name) as "Name", p.email FROM People p JOIN Faculty f ON f.people_id = p.people_id WHERE p.people_id = f.people_id
		)data;
		return data;
	ELSE 
		SIGNAL SQLSTATE '22003'
		SET MESSAGE_TEXT = 'INVALID PERSON TYPE',
		mySQL_ERRNO = 1146;
	END IF;
    
END ;;
DELIMITER ;
