CREATE DEFINER=`af25andrb1`@`localhost` FUNCTION `get_student_id`(student_first_name VARCHAR(255),
    student_last_name VARCHAR(255)
) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	DECLARE ID INT(11);
    SET ID = NULL;
    SELECT student_id 
    INTO ID 
    FROM Students s
    JOIN People p ON s.people_id = p.people_id
    WHERE EXISTS (SELECT * FROM People WHERE p.first_name = student_first_name AND p.last_name = student_last_name);
    
