CREATE DEFINER=`af25andrb1`@`localhost` PROCEDURE `pay_bill`(
	IN student_first_name VARCHAR(255),
    IN student_last_name VARCHAR(255),
    IN payment_amount DECIMAL(19,4),
    IN bill_semester_id INT(11),
    IN user_id INT(11)
)
BEGIN

Declare ID int(11); -- used for data validation that the student exists
Declare current_balance DECIMAL(19,4); -- used to store the current balance on the bill
Declare end_message VARCHAR(255);
DECLARE v_error_msg VARCHAR(255); 
DECLARE v_sqlstate CHAR(5);
DECLARE v_errno INT;
DECLARE v_num_errors INT DEFAULT 0;
BEGIN
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    
    GET DIAGNOSTICS CONDITION 1  -- the most recent error that triggered your handler
      v_sqlstate = RETURNED_SQLSTATE,
      v_errno    = MYSQL_ERRNO,
      v_error_msg      = MESSAGE_TEXT;
      
	  SET v_error_msg = LEFT(CONCAT_WS('',
		  'Proc failed [', IFNULL(v_sqlstate,'HY000'), '/',
		  IFNULL(v_errno,0), ']: ',
		  IFNULL(v_error_msg,'(no message)')
		), 512);  -- using LEFT to make sure we don't exceed the lenght of an error message
        
    ROLLBACK;
    
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = v_error_msg;
  END;
SET ID = NULL;
SET ID = get_student_id(student_first_name, student_last_name);
IF ID IS NULL THEN -- check to make sure the student exists
	SIGNAL SQLSTATE '22003'
    SET MESSAGE_TEXT = 'Student does not exist in table',
    mySQL_ERRNO = 1146;
END IF;
SET current_balance = NULL; -- set the balance to NULL because if the bill doesn't exist the table returns nothing and not a null value
SELECT amount_due INTO current_balance FROM Bill WHERE student_id = ID and semester_id = bill_semester_id; -- selects the amount due from the bill into the current balance
IF current_balance = NULL THEN -- checks that the bill exists in the table
	SIGNAL SQLSTATE '22003'
    SET MESSAGE_TEXT = 'Bill does not exist',
    mySQL_ERRNO = 1146;
END IF;
IF payment_amount > current_balance THEN -- checks for a payment amount greater than the amount due
	SIGNAL SQLSTATE '22003'
    SET MESSAGE_TEXT = 'Payment amount greater than amount due',
    mySQL_ERRNO = 1146;
END IF;

IF payment_amount < 0 THEN -- checks for negative payment amount just in case
	SIGNAL SQLSTATE '22003'
    SET MESSAGE_TEXT = 'Payment amount cannot be negative',
    mySQL_ERRNO = 1146;
END IF;

START TRANSACTION;
UPDATE Bill
SET amount_due = current_balance - payment_amount, audit_user_id = user_id, audit_TIMESTAMP = CURRENT_TIMESTAMP
WHERE student_id = ID and semester_id = bill_semester_id;


SELECT amount_due INTO current_balance FROM Bill WHERE student_id = ID and semester_id = bill_semester_id;
IF current_balance = 0 THEN
	SELECT "Bill was fully paid" into end_message;
ELSE
	SELECT CONCAT("Bill has ", current_balance, " left to be paid.") into end_message;
END IF;
COMMIT;
SELECT end_message;
END ;;
